    var responseList = [diabetesData, asthmaData, depressionData]; 
    var diseaseList = ["Diabetes", "Asthma","Depression"];
    var rootChildren = [];
    var articleCounter = 0;
    // loops through each disease themed json response 
    for (var responseIndex in responseList) {
    let response = responseList[responseIndex];
    var diseaseBasedArticleCounter = 0;
    var diseaseRelatedDrugs = [];
    // loops through each article list for an article for a particular disease
    for (var articleListIndex in response.result.docs) {
        diseaseBasedArticleCounter++;
        let anArticle = response.result.docs[articleListIndex].source.enriched.url;
        var crossfilterController = crossfilter(anArticle.entities);
        // make a dimension on the entity type
        var typeDim  = crossfilterController.dimension(function(d) {return d.type;});
        var drugFilter = typeDim.filter("Drug"); 
        // add the data required for the visualisation for a 'leaf node' 4th level child (article name)
        for (var i in drugFilter.top(Infinity)) {
        var entity = drugFilter.top(Infinity)[i];
        entity["name"] = anArticle.title.substring(0,50);
        entity["parent"] = entity.text;
        entity["url"] = anArticle.url;
        console.log(entity)
        entity["sentiment"] = entity.sentiment.type;
        diseaseRelatedDrugs.push(entity)
        } 
    }
    var c = crossfilter(diseaseRelatedDrugs);
    var textDim = c.dimension(function(d) {return d.text});
    var groups = textDim.group();
    var child =[]
    // use the grouped data to create the 3rd level children (drug name)
    for (var aDrugIndex in groups.top(Infinity)) {
        var drugPerArray = textDim.filter(groups.top(Infinity)[aDrugIndex].key).top(Infinity);
        var children = {"parent": diseaseList[responseIndex], "count": groups.top(Infinity)[aDrugIndex].value, "children": drugPerArray, "name": groups.top(Infinity)[aDrugIndex].key};
        child.push(children);
    }
    // construct the 2nd level children (disease)
    var branch = {"name": diseaseList[responseIndex], "parent": "Articles", "count": diseaseBasedArticleCounter, "children": child};
    rootChildren.push(branch);
    articleCounter = articleCounter + diseaseBasedArticleCounter;
    diseaseBasedArticleCounter = 0;   
    }
    // assemble the whole tree data structure
    var treeData = [
    {
        "name": "Articles",
        "parent": "null",
        "count": articleCounter,
        "children" : rootChildren
    }
    ];
    console.log(treeData)


    // ************** Generate the tree diagram	 *****************
    var margin = {top: 20, right: 120, bottom: 20, left: 120},
        width = 1600 - margin.right - margin.left,
        height = 700 - margin.top - margin.bottom;
        
    var i = 0,
        duration = 750,
        root;

    var tree = d3.layout.tree()
        .size([height, width]);

    var diagonal = d3.svg.diagonal()
        .projection(function(d) { return [d.y, d.x]; });

    var svg = d3.select(".dendrogram").append("svg")
        .attr("width", width + margin.right + margin.left)
        .attr("height", height + margin.top + margin.bottom)
    .append("g")
        .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

    root = treeData[0];
    root.x0 = height / 2;
    root.y0 = 0;
    
    update(root);

    d3.select(self.frameElement).style("height", "500px");

    function update(source) {

    // Compute the new tree layout.
    var nodes = tree.nodes(root).reverse(),
        links = tree.links(nodes);

    // Normalize for fixed-depth.
    nodes.forEach(function(d) { d.y = d.depth * 180; });

    // Update the nodes
    var node = svg.selectAll("g.node")
        .data(nodes, function(d) { return d.id || (d.id = ++i); });

    // Enter any new nodes at the parent's previous position.
    var nodeEnter = node.enter().append("g")
        .attr("class", "node")
        .attr("transform", function(d) { return "translate(" + source.y0 + "," + source.x0 + ")"; })
        .on("click", click);

    nodeEnter.append("circle")
        .attr("r", 1e-10)
        .style("stroke", function(d) { if (d.sentiment === "negative") { return "#ff4d4d"} else if(d.sentiment === "positive") {return "#70db70"} else { return "steelblue"}})
        .style("fill", function(d) { return d._children ? "lightsteelblue" : "#fff"; });

    nodeEnter.append("text")
        .attr("x", function(d) { return d.children || d._children ? -13 : 13; })
        .attr("dy", ".35em")
        .attr("text-anchor", function(d) { return d.children || d._children ? "end" : "start"; })
        .text(function(d) { return d.name + " (" + d.count + ")"; })
        .style("fill-opacity", 1e-6);

    // Transition nodes to their new position.
    var nodeUpdate = node.transition()
        .duration(duration)
        .attr("transform", function(d) { return "translate(" + d.y + "," + d.x + ")"; });

    nodeUpdate.select("circle")
        .attr("r", function(d) { if (d.relevance === undefined) { return 10; } else {return d.relevance * 20;}})
        .style("fill", function(d) { return d._children ? "lightsteelblue" : "#fff"; });

    nodeUpdate.select("text")
        .style("fill-opacity", 1);

    // Transition exiting nodes to the parent's new position.
    var nodeExit = node.exit().transition()
        .duration(duration)
        .attr("transform", function(d) { return "translate(" + source.y + "," + source.x + ")"; })
        .remove();

    nodeExit.select("circle")
        .attr("r", 1e-6);

    nodeExit.select("text")
        .style("fill-opacity", 1e-6);

    // Update the links
    var link = svg.selectAll("path.link")
        .data(links, function(d) { return d.target.id; });

    // Enter any new links at the parent's previous position.
    link.enter().insert("path", "g")
        .attr("class", "link")
        .attr("d", function(d) {
            var o = {x: source.x0, y: source.y0};
            return diagonal({source: o, target: o});
        });

    // Transition links to their new position.
    link.transition()
        .duration(duration)
        .attr("d", diagonal);

    // Transition exiting nodes to the parent's new position.
    link.exit().transition()
        .duration(duration)
        .attr("d", function(d) {
            var o = {x: source.x, y: source.y};
            return diagonal({source: o, target: o});
        })
        .remove();

    // Stash the old positions for transition.
    nodes.forEach(function(d) {
        d.x0 = d.x;
        d.y0 = d.y;
    });
    }

    // Toggle children on click.
    function click(d) {
    if (d.children) {
        d._children = d.children;
        d.children = null;
    } else {
    
        d.children = d._children;
        d._children = null;
    }
    update(d);
    }
